import React from 'react';
import SignUp from './SignUp'; // SignUp bileşenini içe aktarıyoruz

function App() {
  return (
      <Router>
        <div className="App">
          <Switch>
            <Route path="/signup" component={SignUp} />
            <Route path="/" exact>
              <header className="App-header">
                <Link to="/signup">Sign Up</Link>
              </header>
            </Route>
          </Switch>
        </div>
      </Router>
  );
}
